ALLEN&HEATH ZED60-10FX ミキサー<br><br>マルチパーパス・ミキサー with FX<br>ライブ、レコーディングに最適なエフェクト内蔵多目的ミキサー<br><br>■特徴<br>・マイク/ライン・インプット×4（うち2系統はクラスA FETハイ・インピーダンス仕様）<br>・60mmプロ仕様フェーダーを装備<br>・ミッドバンドに音楽的なイコライジングを簡単に行える「MusiQ」を搭載した3バンドEQ<br>・USBステレオ・イン/アウト（設定可能）<br>・AUXセンド（プリフェーダー）×1<br>・ステレオ・インプット×2<br>・独立2トラックレコーディング・アウト端子<br>・内蔵エフェクト（16タイプ）<br>・XLRメイン・アウトプット（インサーション付き）<br>・柔軟な使用が可能なモニター・セクション<br>・48Vファンタム電線<br>・ゲイン・ブースト付きDIレベル・スイッチ（ハイ・インピーダンス・インプット：リアパネル）<br>・モノ・インプット・チャンネル1 ４にはXLR端子と標準ジャックを装備<br><br><br>ライブに、スタジオに。ZED60-10FXはソロ・アーティストや小編成バンドに最適のコンパクト・ミキサーです。<br><br>ALLEN & HEATHのヒット・モデルであるZED-10FXをベースに、高品位60mmフェーダーを装備し、直感的で自由度の高いミックスを行えます。<br><br>ZED60-10FXは、ギタリストにもフレンドリーなミキサーです。4系統のモノ・チャンネルのうち2チャンネル分は、ギターをDI（ダイレクト・ボックス）なしでそのまま接続できるハイ・インピーダンス入力にも対応しています。また、インプット段は往年のチューブ・プリアンプのサウンドを再現できるよう設計され、クリアで暖かみのあるサウンドが特徴的です。MP3/CDプレイヤーやキーボードの接続に便利なステレオ・インプットも2系統装備しました。<br><br>ZED60-10FXは、USBオーディオ・インプット/アウトプットにも対応し、本機でまとめたステレオ信号をコンピュータで録音することも簡単に行なえます。また、プロ仕様のXLRメイン・アウトプットや、ヘッドフォンやスピーカーなど、信号の送り出しが柔軟に行えるモニター・セクション、16タイプの高品位エフェクトを内蔵しています。<br><br>ZED60-10FXはコンパクト・サイズでありながらも、製品クオリティは40年以上にわたりプロ・オーディオの世界をリードしてきましたALLEN & HEATHの厳しい品質基準をパスしたまさにプロ・クオリティのミキサーです。<div style="background:#C00; color:#fff; margin:0; width:200px; text-align:center; padding:5px 10px; font-size:90%; border-top-left-radius:5px; border-top-right-radius:5px;">配送方法について</div>
