ACOUSTIC ADVANCE AMP-TB 吸音パネル 天井用 ピンタイプ（フック付き） ベージュ 4枚セット<br><br>オーディオ環境、室内での楽器の演奏、ホームシアター、ミーティングルームの音質環境の改善に最適なACOUSTIC ADVANCEブランドの吸音パネル「Acoustic Mute Panel」。<br><br>天井にフックで取り付けるタイプ。<br><br>大量の繊維を約5ｍｍの厚さまで圧縮した密度の高い薄型吸音材で、中高音域を幅広く吸音し、余分な反響を抑えます。<br><br>パネルは約300ｇと軽く、ポリエステルなので触れても安心・安全です。<br><br>同ブランドの壁用ミュートパネル、コーナー用吸音パネルと合わせて使用するとより効果的です。<br><br>メイドインジャパンなので安心・高品質。<br><br>製品サイズ：横幅450mm × 縦450mm × 厚み5mm 重量320g<div style="background:#C00; color:#fff; margin:0; width:200px; text-align:center; padding:5px 10px; font-size:90%; border-top-left-radius:5px; border-top-right-radius:5px;">配送方法について</div>
